import React, {Fragment} from 'react';
import { Grid } from "@material-ui/core";
import AddUserSection from "./AddUserSection";
import DepartmentSection from "./DepartmentSection";
import DashboardDrawer from "../../components/DashboardDrawer/DashboardDrawer";

const AdminSection = props => {
  return (
    <Fragment>
      {/*<DashboardDrawer isDrawerOpen={isDrawerOpen} setDrawerOpen={setDrawerOpen} />*/}
      <Grid container justify={"center"} style={{ padding: "16px", marginTop: 72 }}>
        {/*<Grid item xs={2} />*/}
        <Grid item xs={12}>
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <AddUserSection />
            </Grid>
            <Grid item xs={12}>
              <DepartmentSection />
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </Fragment>
  );
};

export default AdminSection;
